import React from "react";
import theme from "../styles/theme";

const OtherProject = ({ project, description }) => (
  <div className="card">
    <h3>{project}</h3>
    <p>{description}</p>
    <style jsx>
      {`
        .card {
          display: block;
          width: 180px;
          height: 250px;
          padding: 18px;
          border: solid 1px ${theme.colors.gray};
          margin-right: 15px;
          margin-bottom: 15px;
          border-radius: 5px;
          background-color: white;
        }
        h3 {
          color: ${theme.colors.black};
        }
        p {
          text-align: right;
        }
      `}
    </style>
  </div>
);

export default OtherProject;
